import Video from "./Video";
import { useState } from "react";

const ModalApp = () => {
  const [cerrar, setCerrar] = useState(false);
  const cerrarModal = () => {
    setCerrar(true);
  };

  return (
    <div is={cerrar}>
      <div className="overlay">
        <div className="popup">
          <i class="far fa-times-circle" onClick={cerrarModal}></i>
          <Video />
        </div>
      </div>
    </div>
  );
};
export default ModalApp;
